import React from "react";

export const Tile = ({ tile }) => {
  return (
    <div className="tile-container">
      {Object.entries(tile).map((value, index) => (
        <p key={index} className={tile === 0 ? "title-tiles" : "tiles"}>
          {value}
        </p>
      ))}
    </div>
  );
};
